import handleProfileSignup from './3-all';

// Test successful case
console.log('--- Testing successful signup ---');
handleProfileSignup();

// To test the error case, let's modify utils temporarily
// We'll create a version that can fail
function createFailingUtils() {
  return {
    uploadPhoto: () => Promise.reject(new Error('Upload failed')),
    createUser: (firstName, lastName) => Promise.resolve({ firstName, lastName })
  };
}

// Test error case by creating a failing version
console.log('\n--- Testing signup with failure ---');
import { uploadPhoto, createUser } from './utils.js';

function handleProfileSignupWithError() {
  // Simulate one of the promises failing
  return Promise.all([
    Promise.reject(new Error('Network error')), // This will cause failure
    createUser('Guillaume', 'Salva')
  ])
    .then(([photoResponse, userResponse]) => {
      console.log(`${photoResponse.body} ${userResponse.firstName} ${userResponse.lastName}`);
    })
    .catch(() => {
      console.log('Signup system offline');
    });
}

// Wait a bit then test the error case
setTimeout(() => {
  handleProfileSignupWithError();
}, 100);

