import signUpUser from './4-user-promise';

// Test the basic functionality
console.log('--- Testing signUpUser function ---');
const promise = signUpUser('Bob', 'Dylan');
console.log('Promise object:', promise);
console.log('Is Promise?', promise instanceof Promise);

// Test promise resolution
promise.then(result => {
  console.log('✅ Resolved result:', result);
  console.log('✅ firstName:', result.firstName);
  console.log('✅ lastName:', result.lastName);
});

